import React from 'react';


const Movies=(props)=>{
 const {movie}=props;
 const url="http://image.tmdb.org/t/p/w185"

return(
  <>
  <div className="row ">
      {
          movie.map((val)=>(
                <div className="col-md-4 my-2">
                    <div className="card">
                        <img src={val.backdrop_path} alt="movie"/>
                        <div className="card-title">
                        <h5>{val.title}</h5>
                        </div>
                        <div className="card-title">
                        <h5>{url+val.overview}</h5>
                        </div>
                    </div>
                </div>
          ))
      }
  </div>
  </>
);
}
export default Movies;
